import sys


def main():
    N = int(sys.stdin.readline())
    mochis = []
    for i in range(N):
        mochis.append(int(sys.stdin.readline()))
    mochis.sort()
    mochis.reverse()
    ans = 0
    while mochis:
        ans += 1
        mochis.pop(0)
        while mochis:
            if mochis[0] < mochis[-1]:
                mochis.pop()
            else:
                break
    print(ans)


if __name__ == "__main__":
    main()
